import React from 'react';
import Head from 'next/head';
import styles from './intro.module.scss';

const Navbar = () => (
    <div  className={styles.navbarContainer}>    
            <Head>
                <title> Pablo Pose</title>
            </Head>
            <h1> Pablo Pose</h1>
    </div>
)

export default Navbar;
